//评论功能组件
Vue.component('pinglun', {
    template: '#pinglun',
    data() {
        return {
            person: '',
            neirong: '',
            list: [
                { person: '种花家', neirong: '厉害了，我的国' },

            ]
        }
    },
    methods: {
        addpinglun() {
            if (this.person == '') {
                alert('评论人不应为空')
            } else if (this.neirong == '') {
                alert('内容不应为空')
            } else {
                var newpinglun = { person: this.person, neirong: this.neirong }
                this.list.unshift(newpinglun)
                this.person = this.neirong = ''
            }
        }
    }
})
